import React from 'react';
import {
    View,
    Text
} from 'react-native';
import { COLORS } from '../constants';

const MainLayout = () => {
    return (
        <View
            style={{
                flex: 1,
                alignItems: 'center',
                justifyContent: 'center',
            }}
        >
            <Text>Ahmet</Text>
        </View>
    )
}

export default MainLayout;
